goog.provide("goog.dom.NodeIteratorTest");goog.setTestOnly("goog.dom.NodeIteratorTest");goog.require("goog.dom");goog.require("goog.dom.NodeIterator");goog.require("goog.testing.dom");goog.require("goog.testing.jsunit");function testBasic(){goog.testing.dom.assertNodesMatch(new goog.dom.NodeIterator(goog.dom.getElement("test")),["#test","#a1","T","#b1","e","xt","#span1","#p1","Text"])}function testUnclosed(){goog.testing.dom.assertNodesMatch(new goog.dom.NodeIterator(goog.dom.getElement("test2")),["#test2","#li1","Not","#li2","Closed"])}function testReverse(){goog.testing.dom.assertNodesMatch(new goog.dom.NodeIterator(goog.dom.getElement("test"),!0),["Text","#p1","#span1","xt","e","#b1","T","#a1","#test"])}